css:
.github-FilePatchListView:empty:before {
  content: 'No changes';
  display: block;
  padding: 12px;
  text-align: center;
  color: #e2e2e2;
  font-style: italic;
}
.github-FilePatchListView-item {
  position: relative;
  display: flex;
  align-items: flex-start;
  padding: 6px 12px;
  padding-left: 42px;
  overflow: hidden;
  -webkit-user-select: none;
  cursor: default;
}
.github-FilePatchListView-icon {
  text-align: right;
}
.github-FilePatchListView-icon:before {
  margin-right: 10px;
}
.github-FilePatchListView-path {
  flex: 1;
  word-break: break-word;
}
.github-FilePatchListView-resolutionItem {
  padding-top: 0;
  padding-bottom: 6px;
}
.github-MergeConflictPaths .github-FilePatchListView-icon:last-child {
  margin-left: 6px;
}
